import React, { useEffect, useState } from "react";
import { useParams, Link } from "react-router-dom";

const CONTEXT_LINES = 5;

export default function PRDetails() {
  const { owner, repo, number } = useParams();
  const [prDetails, setPrDetails] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState("");
  const [expandedHunks, setExpandedHunks] = useState({}); // Track per hunk

  useEffect(() => {
    const fetchPRDetails = async () => {
      const token = localStorage.getItem("authToken");
      if (!token) {
        setError("No authentication token found.");
        setLoading(false);
        return;
      }

      try {
        const res = await fetch(
          `http://localhost:5001/github/repos/${owner}/${repo}/pulls/${number}/details`,
          { headers: { Authorization: `Bearer ${token}` } }
        );
        if (!res.ok) throw new Error(`Failed to fetch PR details: ${res.status}`);
        const data = await res.json();
        setPrDetails(data);
      } catch (err) {
        setError(err.message);
      } finally {
        setLoading(false);
      }
    };

    fetchPRDetails();
  }, [owner, repo, number]);

  if (loading) return <p className="text-center mt-5">Loading PR details...</p>;
  if (error) return <p className="text-center text-danger mt-5">{error}</p>;
  if (!prDetails) return <p className="text-center mt-5">No details found for this PR.</p>;

  const { details, files } = prDetails;

  const parseHunks = (patch) => {
    const lines = patch.split("\n");
    const hunks = [];
    let currentHunk = null;
    let oldLine = 0,
      newLine = 0;

    lines.forEach((line) => {
      if (line.startsWith("@@")) {
        const match = /@@ -(\d+),?\d* \+(\d+),?\d* @@/.exec(line);
        if (match) {
          oldLine = parseInt(match[1], 10) - 1;
          newLine = parseInt(match[2], 10) - 1;
        }
        if (currentHunk) hunks.push(currentHunk);
        currentHunk = { header: line, lines: [] };
      } else if (currentHunk) {
        let type = "unchanged";
        let displayOld = oldLine + 1;
        let displayNew = newLine + 1;

        if (line.startsWith("+")) {
          type = "added";
          displayOld = "";
          newLine++;
        } else if (line.startsWith("-")) {
          type = "removed";
          displayNew = "";
          oldLine++;
        } else {
          oldLine++;
          newLine++;
        }

        currentHunk.lines.push({ line, type, oldLine: displayOld, newLine: displayNew });
      }
    });
    if (currentHunk) hunks.push(currentHunk);
    return hunks;
  };

  const expand = (fileName, hunkIndex, direction) => {
    setExpandedHunks((prev) => {
      const key = `${fileName}-${hunkIndex}`;
      const state = prev[key] || { above: 0, below: 0 };
      const change = CONTEXT_LINES;
      const updated = {
        above: direction === "above" ? state.above + change : state.above,
        below: direction === "below" ? state.below + change : state.below,
      };
      return { ...prev, [key]: updated };
    });
  };

  const collapse = (fileName, hunkIndex, direction) => {
    setExpandedHunks((prev) => {
      const key = `${fileName}-${hunkIndex}`;
      const state = prev[key] || { above: 0, below: 0 };
      const updated = {
        above: direction === "above" ? Math.max(0, state.above - CONTEXT_LINES) : state.above,
        below: direction === "below" ? Math.max(0, state.below - CONTEXT_LINES) : state.below,
      };
      return { ...prev, [key]: updated };
    });
  };

  const expandAll = (fileName, hunks) => {
    setExpandedHunks((prev) => {
      const updated = { ...prev };
      hunks.forEach((_, hIdx) => {
        const key = `${fileName}-${hIdx}`;
        updated[key] = { above: 1000, below: 1000 }; // Large number to expand fully
      });
      return updated;
    });
  };

  const collapseAll = (fileName, hunks) => {
    setExpandedHunks((prev) => {
      const updated = { ...prev };
      hunks.forEach((_, hIdx) => {
        const key = `${fileName}-${hIdx}`;
        updated[key] = { above: 0, below: 0 };
      });
      return updated;
    });
  };

  return (
    <div className="container py-4">
      <div className="d-flex justify-content-between align-items-center mb-4">
        <h2>
          PR #{details.number}: <span className="text-primary">{details.title}</span>
        </h2>
        <Link to={`/repos/${owner}/${repo}/prs`} className="btn btn-secondary">
          ⬅ Back to PR List
        </Link>
      </div>

      <hr />
      <h4>Files Changed</h4>

      {files.map((file, fIdx) => {
        const hunks = parseHunks(file.patch || "");

        return (
          <details key={fIdx} open className="mb-3">
            <summary
              style={{
                cursor: "pointer",
                fontWeight: "bold",
                fontSize: "1.1rem",
                padding: "5px 10px",
                backgroundColor: "#f0f0f0",
                borderRadius: "5px",
              }}
            >
              {file.filename}
            </summary>

            <div
              style={{
                margin: "10px 0",
                display: "flex",
                gap: "10px",
              }}
            >
              <button className="btn btn-sm btn-primary" onClick={() => expandAll(file.filename, hunks)}>
                Expand All
              </button>
              <button className="btn btn-sm btn-secondary" onClick={() => collapseAll(file.filename, hunks)}>
                Collapse All
              </button>
            </div>

            <div
              style={{
                maxHeight: "400px",
                overflow: "auto",
                border: "1px solid #ccc",
                borderRadius: "5px",
                marginTop: "5px",
                padding: "10px",
                backgroundColor: "#f6f8fa",
                fontFamily: "monospace",
              }}
            >
              {hunks.map((hunk, hIdx) => {
                const key = `${file.filename}-${hIdx}`;
                const expandState = expandedHunks[key] || { above: 0, below: 0 };

                return (
                  <div key={hIdx} style={{ marginBottom: "15px" }}>
                    <div style={{ fontWeight: "bold", color: "#555" }}>{hunk.header}</div>

                    <div style={{ marginBottom: "5px" }}>
                      <button
                        className="btn btn-sm btn-outline-secondary me-2"
                        onClick={() => expand(file.filename, hIdx, "above")}
                      >
                        ⬆ Expand above
                      </button>
                      <button
                        className="btn btn-sm btn-outline-secondary me-2"
                        onClick={() => collapse(file.filename, hIdx, "above")}
                      >
                        ⬆ Collapse above
                      </button>
                      <button
                        className="btn btn-sm btn-outline-secondary me-2"
                        onClick={() => expand(file.filename, hIdx, "below")}
                      >
                        ⬇ Expand below
                      </button>
                      <button
                        className="btn btn-sm btn-outline-secondary"
                        onClick={() => collapse(file.filename, hIdx, "below")}
                      >
                        ⬇ Collapse below
                      </button>
                    </div>

                    {hunk.lines.map((lineObj, i) => {
                      const showLine =
                        lineObj.type !== "unchanged" ||
                        (lineObj.type === "unchanged" &&
                          i >= Math.max(0, i - expandState.above) &&
                          i <= Math.min(hunk.lines.length - 1, i + expandState.below));

                      if (!showLine) return null;

                      let style = {};
                      if (lineObj.type === "added") style = { backgroundColor: "#d4f8d4" };
                      if (lineObj.type === "removed") style = { backgroundColor: "#f8d4d4" };

                      return (
                        <div key={i} style={style}>
                          <span
                            style={{
                              display: "inline-block",
                              width: "50px",
                              textAlign: "right",
                              paddingRight: "10px",
                              color: "#888",
                            }}
                          >
                            {lineObj.oldLine || ""}
                          </span>
                          <span
                            style={{
                              display: "inline-block",
                              width: "50px",
                              textAlign: "right",
                              paddingRight: "10px",
                              color: "#888",
                            }}
                          >
                            {lineObj.newLine || ""}
                          </span>
                          <span>{lineObj.line}</span>
                        </div>
                      );
                    })}
                  </div>
                );
              })}
            </div>
          </details>
        );
      })}
    </div>
  );
}
